  it("Another user should be able to contribute to a contract if the value is within the requirement", function(){
    var app;
    var acceptor = accounts[2];
    var acceptorAmount = web3.toWei(0.5, "ether");
    var insuranceID;

    return Insurance.deployed().then(function(instance) {
      app = instance;
    }).then(function(){
      return app.getInsuranceContracts();
    }).then(function(contracts){
      insuranceID = contracts[0].toNumber();
      app.acceptContract(insuranceID, {from: acceptor, value: acceptorAmount})
    }).then(function(){
      assert.equal(insuranceID,1000,"the insurance ID is not correct")
      return app.allInsuranceCovers(insuranceID);
    }).then(function(contract){
      assert.equal(contract[2].toNumber(), 2, "the number of providers has not been incremented");
      assert.equal(contract[4].toNumber(), acceptorAmount*2, "the contract has recorded the right amount of capital");
      assert.equal(contract[7], true, "the contract has not been changed to filled");
    })
  });

